import React, { Component, Fragment } from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { getMission, deleteMission } from "../../actions/missions";

export class Missions extends Component {
  static propTypes = {
    missions: PropTypes.array.isRequired,
    getMission: PropTypes.func.isRequired,
    deleteMission: PropTypes.func.isRequired
  };

  componentDidMount() {
    this.props.getMission();
  }
  render() {
    return (
      <Fragment>
        <h2>Mission</h2>
        <table className="table table-stripped">
          <thead>
            <tr>
              <th>MISSION</th>
              <th />
            </tr>
          </thead>
          <tbody>
            {this.props.missions.map(mission => (
              <tr key={mission.id}>
                <td>
                  <button
                    onClick={this.props.deleteMission.bind(this, mission.id)}
                    className="btn btn-danger btn-sm"
                  >
                    Delete
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </Fragment>
    );
  }
}

const mapStateToProps = state => ({
  missions: state.missions.missions
});
export default connect(mapStateToProps, { getMission, deleteMission })(
  Missions
);
